import React, { Component } from "react";
import CarouselWithCaprion from "../components/CarouselWithCaprion";

class ProductPage extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>{this.props.match.params.id}</h1>
        <CarouselWithCaprion />
      </div>
    );
  }
}

export default ProductPage;
